import React, { Component, useState, useEffect } from 'react';


const Like = () => {
    const [liked, setLiked] = React.useState(false);
    const onClick = event => setLiked(this.ListeningStateChangedEvent({liked: true}));

    useEffect(() => {
        document.title = 'hi';
    }, [liked]);
    
    if (liked === null) {
        return (
            <button class="btn btn-info" onClick={setLiked}>
            Like
            </button>
        )
    }

    return (
      <div>
        <h1>Hello React Function Component!</h1>
        
      </div>

    );

  };


export default Like;
